import React from 'react';
import { CarouselItem } from './carouselItem';

export const Carousel = () => {

    const items = [
        {
            src: require("./data/2019/Khartoum/forum1.6cce6ab7.jpg"),
            alt: "p1"
        },
        {
            src: require("./data/2019/Khartoum/forum2.77028c90.png"),
            alt: "p2"
        },
        {
            src: require("./data/2019/Khartoum/forum3.4c22e2b8.jpg"),
            alt: "p3"
        }
    ];
    return (
        <div className='carousel'>
            <div>
                Carousel
            </div>
            <div className='inner'>
                {items.map((item) => {
                    return <CarouselItem item={item} />
                })}
            </div>
        </div>
    );
};
